import React from "react";
import {Button} from './styles';

interface  Props{
    text:string
}
const OrangePinkButton:React.FC<Props> = ({text})=>{
    return (
        <Button>
            <a href="https://uspdigital.usp.br/jupiterweb/listarGradeCurricular?codcg=97&codcur=97001&codhab=0&tipo=N">{text}</a>
        </Button>
    )
}

export default OrangePinkButton;
